import React from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";

const Home = (props) => {
  return (
    <div>
      <h1>My home page</h1>
      <p>
        Go to <Link to="/products">the list of products</Link>
      </p>
    </div>
  );
};

Home.propTypes = {};

export default Home;
